(2184, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:73:\"Introducing Elementor Experts: The New Discovery Network For Web Creators\";s:7:\"excerpt\";s:232:\"We are proud to launch Elementor Experts, a brand new expert discovery network for web creators. Experts will help you showcase your best work, get hired or hire professional designers, marketers, and developers, all in one place.\r\n\";s:7:\"created\";s:10:\"1585657322\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:119:\"https://elementor.com/blog/introducing-experts/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:59:\"Elementor Community Online: Meetup Guidance During COVID-19\";s:7:\"excerpt\";s:132:\"By and for the community, Elementor Community leaders are working together, enabling online meetups, to help users around the world.\";s:7:\"created\";s:10:\"1585131418\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:142:\"https://elementor.com/blog/elementor-community-online-meetup-covid-19/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:86:\"Introducing Full Site Editing: Design Your Header, Footer & Content All From One Place\";s:7:\"excerpt\";s:234:\"In these challenging times of COVID, our team perseveres to help web creators work better. The new Pro version does just that, optimizing the most common web design tasks, like being able to edit your entire site with fewer clicks!​\";s:7:\"created\";s:10:\"1584528845\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:129:\"https://elementor.com/blog/introducing-full-site-editing/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:66:\"Monday Masterclass: Essential Tips for Great Minimalist Web Design\";s:7:\"excerpt\";s:202:\"This week we’re tackling Minimalist design, covering the essential characteristics and how to implement them, in order to create the perfect combination of great aesthetics, user experience and speed.\";s:7:\"created\";s:10:\"1584431059\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:130:\"https://elementor.com/blog/tips-for-minimalist-web-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:56:\"How Can Web Creators Prepare for the Corona Virus Threat\";s:7:\"excerpt\";s:147:\"As the COVID-19 virus continues to spread, SMB web creators should be aware of the impact it will have on their businesses and prepare accordingly.\";s:7:\"created\";s:10:\"1584355372\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/prepare-for-corona-virus/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
