(678, 1, '2020-03-24 13:08:05', '2020-03-24 16:08:05', '<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:spacer {\"height\":32} -->\n<div style=\"height:32px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"className\":\"has-2-columns\"} -->\n<div class=\"wp-block-columns has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Giving the pizza its unique flavor and texture is our speciality. Good sauce, right amount of cheese and great crust sets Fratello Pizza apart from other pizza joints .We have a good array of delicious pasta, subs, salads in addition to the more traditional pizzas and speciality pizzas.<br></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The interior is remarkably clean and so brightly lit and shiny that it\'s almost sobering.Our service is quick, efficient, and polite. Come in or call today and experience the great flavor of Food. Good sauce, right amount of cheese and great crust sets Fratello Pizza.<br></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Webertela - restaurant, pizza, food delivery', '', 'inherit', 'closed', 'closed', '', '567-autosave-v1', '', '', '2020-03-24 13:08:05', '2020-03-24 16:08:05', '', 567, 'http://eric.webertela.online/2020/03/24/567-autosave-v1/', 0, 'revision', '', 0),
